class CustomisationPersonnelle extends Component {
    constructor(props) {
        super(props);
        this.state = { text: this.props.CustomisationPersonnelle }
    }
    render() { 
        return ( 
            <div >
                <p>{this.props.CustomisationPersonnelle}</p>
            </div>
         );
    }
}

export default CustomisationPersonnelle;
